import styled from '@emotion/styled'
import { Footer } from '../../component/Footer'
import { Navbar } from '../navigation/Navbar'

const Container = styled.div`
  padding: 3rem 5rem;
`

export const ProductDetailPage = () => {
  return (
    <>
      <Navbar />
      <Container></Container>
      <Footer />
    </>
  )
}
